import React from 'react'
import styles from './index.less'

export default class Header extends React.Component {
  render() {
    return (
      <>
        <header>
          <div className="w header-content">
            <a href="https://www.teddymobile.cn/" className="logo" title="泰迪熊移动">泰迪熊移动</a>
            <ul className="nav">
              <li>
                <a href="">首页</a>
              </li>
            </ul>
          </div>
        </header>
        <style jsx>
          {
            styles
          }
        </style>
      </>
    )
  }
}
